        <div>
            <a>Let's connect</a>
            <div className="flex flex-row">
                <div className="flex flex-row bg-[#d4d6d6]">
                    <input
                        placeholder="Nickname..."
                        className="custom-input"
                        style={{
                            color: "black",
                            backgroundColor: "rgba(212, 213, 214, 1)",
                            borderWidth: 2,
                            // borderColor: '#4f4f4f',
                            borderRadius: "8px",
                            paddingLeft: "10px",
                            paddingRight: "10px",
                            paddingTop: '5px',
                            paddingBottom: '5px',
                            outline: "none",
                            marginRight: "8px",
                            width: 140,
                        }}
                    />
                    <IconButton icon={iconsRef.plus} onClick={handleSearch} />
                </div>

            </div>
        </div>
    );
};

const IconButton = ({ icon, onClick }: { icon: string, onClick: () => void }) => {
    const size = 35;

    return (
        <img
            src={icon}
            width={size}
            height={size}

            onClick={onClick}
            style={{ cursor: 'pointer', padding: 4, paddingLeft: 5, paddingTop: 5, borderRadius: 10 }}
        />
    );
};

export default SearchBar;
